[#GeodisLesEchos] 

« Nos clients sont de plus en plus sensibles aux problématiques environnementales. Le produit qui vient de Chine, dans une enveloppe, il y a quelque chose qui ne va pas »

@otheulle Directeur des Opérations des Systèmes d'Information @Fnac @Darty_Officiel

[#GeodisLesEchos] 

« On doit prévoir les flux. On doit avoir les bons produits dans les bons magasins au bon moment » 

@otheulle, Directeur des Opérations des Systèmes d'Information @Fnac @Darty_Officiel [LIEN]

[#GeodisLesEchos]
« Les prochains chantiers : meilleure interactivité et précision pour le client | capacité de prévision plus précise pour éviter les interventions chez le client | prévision des flux. »

@otheulle, Directeur des Opérations des SI, @Fnac @Darty_Officiel

[#GeodisLesEchos]
« Chaque jour on trie 150k livres qui sont envoyés dans toute la France. On propose aujourd’hui un tri peer-to-peer pour améliorer le travail du libraire en magasin. »

@otheulle, Directeur des Opérations des Systèmes d'Information , @Fnac @Darty_Officiel [LIEN]

[#GeodisLesEchos]

« On a monté une #Digital Factory. On a un savoir-faire extraordinaire, on le rend encore plus pertinent grâce à des technologies très avancées comme l’#IA » 

@otheulle Directeur des Opérations des Systèmes d'Information @Fnac @Darty_Officiel [LIEN]

[#GeodisLesEchos] 

« Notre stratégie c’est de nous différencier sur le service. Notre chiffre d’affaires se fait grâce à Internet. Le #digital représente 20% de notre chiffre d’affaires » 

@otheulle, Directeur des Opérations des Systèmes d'Information @Fnac @Darty_Officiel [LIEN]

